import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ServiceProvidersPage() {
  const [serviceProviders, setServiceProviders] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    const fetchServiceProviders = async () => {
      try {
        const response = await axios.get('http://192.168.164.157:8000/service-providers');
        setServiceProviders(response.data);
        setIsLoading(false);
      } catch (error) {
        console.error('Error fetching service providers:', error);
        setIsLoading(false);
      }
    };

    fetchServiceProviders();
  }, []);

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', minHeight: '100vh', backgroundColor: '#f0f0f0', color: '#000' }}>
      <h1 style={{ color: '#2980b9', marginBottom: '20px' }}>List of Service Providers</h1>
      {isLoading ? (
        <p>Loading...</p>
      ) : (
        <ul style={{ listStyle: 'none', padding: 0, width: '80%' }}>
          {serviceProviders.map((provider, index) => (
            <li key={index} style={{ marginBottom: '10px', borderBottom: '1px solid #ccc', paddingBottom: '10px' }}>
              <p>Email: {provider.email}</p>
              <p>Profession: {provider.profession}</p>
              <p>Contact: {provider.contact}</p>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default ServiceProvidersPage;
